import React from 'react';
import { Button, Jumbotron } from 'reactstrap';

const BooksContainer = () => {
    return (
        <div className="d-flex justify-content-center">
            <Jumbotron className="container-fluid  m-5 clearfix" style={{ padding: '.5rem', backgroundColor: "#F8F9FA" }}>
                <p className="lead">Saved Books</p>
                <Jumbotron>
                    <div class="d-flex justify-content-between">
                        <p className="lead">Harry Potter's Bookshelf</p>
                        <div class="d-flex justify-content-between">
                            <Button type="button" class="btn btn-secondary"></Button>
                            <Button type="button" class="btn btn-secondary"></Button>
                        </div>
                    </div>
                    <p>The Great Books behing Hogwarts Adventures</p>
                    <p>Written by John Doe</p>
                    <row></row>
                </Jumbotron>
            </Jumbotron>
        </div>
    );
};

export default BooksContainer;
